import React, {useEffect} from 'react';
import {Col, Row, Form, Switch, Button} from 'antd';
import { Typography } from 'antd';
import { AudioOutlined } from '@ant-design/icons';
import { List, Input, Space } from 'antd';
import axios from "axios";
const { Search } = Input;


const Home = () => {
    const { Title } = Typography;
    const suffix = (
        <AudioOutlined
            style={{
                fontSize: 16,
                color: '#1890ff',
            }}
        />
    );
    const onSearch = (value) => {
        console.log(value);
        let url = 'http://localhost:8080/stock/queryprice/' + value;
        axios.get(url)
            .then(function (response) {
                let data=response.data.data;
                if(data !== "-1"){
                    console.log(data);

                }else{
                    console.log("fuck");
                }
            })
            .catch(function (error) {
                console.log(error);
            });
    };

    return (
        <div>
            <Title level={1}>STOCK MANAGEMENT</Title>
            <div>
                <Row>
                    <Col span ={8}></Col>
                    <Col span ={8}>
                        <Space>
                            <Search
                                placeholder="Input stock sym"
                                enterButton="Query"
                                size="large"
                                onSearch={onSearch}
                            />
                        </Space>
                    </Col>
                    <Col span ={8}></Col>
                </Row>
                renderItem={(item) => (
                    <div>
                        <List.Item  extra={<Button type="primary" danger style={{display:{editNeeds}.editNeeds?"block":"none"}} onClick={
                            ()=>{

                                let tempData=[...{data}.data];
                                tempData.splice(tempData.indexOf({item}.item), 1);

                                setData(tempData);
                                if(fixedNeeds.indexOf({item}.item)!==-1){
                                    let tempData2=[...{deleteFixedData}.deleteFixedData];
                                    tempData2=tempData2.concat({item}.item);
                                    setFixedDeleteData(tempData2);
                                }

                            }
                        }>Delete</Button>}>
                            {item}
                        </List.Item>
                    </div>
                )}

            </div>
        </div>
    );
};

export default Home;
